import React from "react";

const TerminalMainWindow = () => {
  return (
    <div className="terminalContainer">
      <div>
        <h5 className="fontWeight-600 letterSpacing-3">
          Branch/Terminal Registration
        </h5>
      </div>
      <p className="fontSize14 fontWeight-500 letterSpacing-2">
        Terminal Master
      </p>
      <div className="lightBlueBox">
        <p>Drop your .xls file here</p>
        <p>or</p>
        <p>Browse File</p>
      </div>
      <div>
        <button className="btnPrimaryOutline">Cancel</button>
        <button className="btnPrimary">Submit</button>
      </div>
    </div>
  );
};

export default TerminalMainWindow;
